def readjson(file):
    with open(file,'r',encoding='utf8') as fr:
        data1 = json.load(fr) # 用json中的load方法，将json串转换成字典
    return data1

def writeM():
    datas = readjson('test2.json')
    title = ["_id", "hashID", "rcMember", "consumeTime", "consumptionLocation", "mealType","lastModifiedDate"]
    book = xlwt.Workbook() # 创建一个excel对象
    sheet = book.add_sheet('Sheet1',cell_overwrite_ok=True) # 添加一个sheet页
    for i in range(len(title)): # 循环列
        sheet.write(0,i,title[i]) # 将title数组中的字段写入到0行i列中


    for i in range(len(datas)):#循环列表，取出每一个用户信息
        b = datas[i]
        for j in range(len(title)):
                sheet.write(i+1,j,b[title[j]])

    book.save('demo2.xls')#保存excel
if __name__ == '__main__':
    writeM()
